import sys

def main():
    N, T = map(int, sys.stdin.readline().split())
    routes = list()
    for i in range(N):
        c, t = map(int, sys.stdin.readline().split())
        routes.append((c, t))
    routes.sort()
    for c, t in routes:
        if t <= T:
            print(c)
            return
    print('TLE')

if __name__ == '__main__':
    main()

